import './list.scss';
import { ArrowBackIosOutlined,  } from '@mui/icons-material/ArrowBackIos';

export default function List() {
  return (
   <div className="list">
       <span className="listTitle">Continue to watch</span>
       <div className="wrapper">
            <ArrowBackIosOutlined />
       </div>
   </div>
  )
}
